INSERT INTO `node__body` VALUES ('page',0,1,10,'en',0,'<p>Welcome to Plant-Based Power - your neighborhood market.</p>\r\n','Opening times and location of Plant-Based Power.','basic_html'),('page',0,2,6,'en',0,'<p><strong>Why plant-based?</strong></p>\r\n\r\n<p>It supports your immune system. Plants have essential nutrients that you cannot get from other foods. The vitamins and minerals, phytochemicals and antioxidants in plants help keep your cells healthy and your body in balance so that your immune system can function at its best.</p>\r\n\r\n<p>“Plants give your body what it needs to help fight off infection,” says Andrea Murray, MD Anderson health education specialist. “A plant-based diet strengthens your immune system to protect you against germs and microorganisms.”</p>\r\n\r\n<p>A healthy immune system is essential for reducing your risk for cancer because it can recognize and attack mutations in cells before they can progress to disease.</p>\r\n\r\n<p>Plant foods reduce inflammation. Plants’ essential nutrients work to resolve inflammation in your body. The same tiny phytochemicals and antioxidants that boost your immune system also go around your body neutralizing toxins from pollution, processed food, bacteria, viruses and more.</p>\r\n\r\n<p>“Antioxidants in plants grab all these so-called free radicals that can throw your body off balance,” says Murray. “To reduce inflammation, it’s important to eat plant-based and to listen to your body’s signals for how foods work for you.”</p>\r\n\r\n<p>Prolonged inflammation can damage your body’s cells and tissue and has been linked to cancer and other inflammatory diseases like arthritis. A plant-based diet may protect you because it removes some of the triggers to these diseases.<br />\r\nInfographic: Why eat plant foods. Summarizes sub-headings of the article.</p>\r\n\r\n<p>&nbsp;</p>\r\n','','basic_html'),('vendor',0,3,11,'en',0,'<p>Alan is a wonderful vendor.</p>\r\n','','basic_html'),('recipe',0,4,9,'en',0,'<p>Put together a fresh green salad for a light summer lunch or side. Make the most of vegetables such as crispy lettuce, peas and green beans.</p>\r\n','','basic_html'),('vendor',0,5,12,'en',0,'<p>Anna is an experienced, qualified, and talented vendor.</p>\r\n','','basic_html');
/*!40000 ALTER TABLE `node__body` ENABLE KEYS */;
UNLOCK TABLES;
commit;

